script: |
  super -f text -I q9590.spq | sort > q9590.out

inputs:
  - name: q9590.spq
    data: |
      SELECT col0 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col0 * - - col1 BETWEEN ( + col0 + + - 49 - + col0 + - col0 * - 43 * + 41 * 70 * - 19 ) AND col1 * col1;
  - name: tab0

outputs:
  - name: q9590.out
    data: |
